import "./MovieDetails.css"
import { useDispatch,useSelector } from 'react-redux'
function MovieDetails() {
  const dispatch=useDispatch();
  useEffect(()=>{
    dispatch
  },[])
  return (
    <div>MovieDetails</div>
  )
}

export default MovieDetails
